@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("officeworks.com.au") {
 
body, .navbar-inner, .HomePage, #category-1 a, #category-2 a, 
#category-3 a, #category-4 a, #category-5 a, #category-6 a, 
#category-7 a, #widget_department ul, .sub-category, li a,
.nav, .price, .option, .add-to-cart, #add-to-cart-elements,
.BVRRReviewDisplayStyle5, .BVRRReviewDisplayStyle5BodyUser,
.row0, .row1, #BVRRDisplayContentHeaderID, .section,
.section_list ul
{
background: #000000 !important;
}
.availability
{
background: #019CDC !important;
}
a:hover
{
text-decoration: underline !important;
}
h1, h2, h3, h4, h5
{
color: #019CDC !important;
}
a, p, .title, .icons, .text, label, .checkbox,
.BVRRRatingSummaryLinkReadPrefix, .BVRRRatingSummaryHeader,
.BVQACount, .BVQANonZeroCount, .message, .BVRRReviewText,
.BVRRTitle, .BVRRLabel, .BVRRRatingNormalLabel,
.desc-container, .fab_points, #features, .row0, .row1
{
color: #FFF !important;
}
}
